import React from 'react'
import { useHistory } from 'react-router';
export default function EditAccount() {

    let history = useHistory();

    function logout() {
        sessionStorage.clear();
        history.push("/");
    }


    return (
        <>
            <h1 className="h1 mt-1" style={{ fontSize: "48px" }}>Edit Your Account</h1>
            <form onSubmit={console.log("submitting")} className="w-75">    
                <div className="form-group my-3 text-center">
                    <input type="email" className="form-control signup-input" placeholder="Email" />
                    <p className="text-danger">An error will go here</p>
                </div>
                <div className="form-group my-3">
                    <input type="password" className="form-control signup-input" placeholder="Password"/>
                    <p className="text-danger">An error will go here</p>
                </div>
                <div className="form-group my-3">
                    <input type="password" className="form-control signup-input" placeholder="Confirm password"/>
                    <p className="text-danger">An error will go here</p>
                </div>
                <button type="submit" className="btn btn-light rounded-pill register-page-button w-100 p-55 mt-5 mb-3" id="signup-submit-button">Sign up</button>
            </form>
        </>
    )
}
